INSERT INTO `jh_dynamic` VALUES (8,'精弘综合管理系统V2.0版上线拉!欢迎精弘全体成员使用','历时一个暑假,精弘综合管理系统V2.0版终于和大家见面拉!欢迎精弘全体成员使用...最新添加消息模块!有任何意见都可以直接发送给精弘管理层!未来将添加短信功能~~~~','2010-09-07 22:22:14');
INSERT INTO `jh_dynamic` VALUES (9,'精弘综合管理V2.0版修正了一个按职务分页查询的BUG［已解决］','精弘综合管理V2.0版修正了一个按职务分页查询的BUG［已解决］．目前选择按用户职务筛选，跳转到下一页也正常显示剩余数据，一切显示正常．欢迎大家使用精弘管理，并提出改进意见．我们将针对性的修正程序BUG并即时以动态形式通知各位','2010-09-17 05:52:42');
INSERT INTO `jh_dynamic` VALUES (10,'修正了课表编辑的用户选择列表未锁定的BUG并对课表添加补充了提示','修正了课表编辑的用户选择列表未锁定的BUG并对课表添加补充了提示，对显示动态对话框无法关闭也进行了修正','2010-09-18 07:53:53');
INSERT INTO `jh_dynamic` VALUES (11,'关于统计部门信息的通知','于中秋结束前即9-2４晚00：００前，将各自负责的精弘部门的全部成员信息作一个excel的统计：需要学号，姓名，联系方式三项［用于精弘综合管理系统初始化］','2010-09-20 22:35:01');
INSERT INTO `jh_dynamic` VALUES (12,'精弘部长级成员开通了用户查询权限，回复短消息功能开通并更新了部分BUG[已完成]','精弘部长级成员开通了用户查询权限并更新了部分BUG[已完成],主要BUG有个人编辑课表不成功时返回可放大用户选择，该bug已修正，欢迎大家对管理系统提出意见和建议．．．','2010-09-23 10:48:54');
INSERT INTO `jh_dynamic` VALUES (13,'[温馨提示]精弘综合管理系统最新版地址为http://210.32.200.95:8080/jh_system','[温馨提示]精弘综合管理系统最新版地址为http://210.32.200.95:8080/jh_system,而不是http://m.zjut.com.虽然m.zjut.com也可用，但功能不全，存在BUG，希望大家注意地址．．．','2010-09-24 14:22:49');
INSERT INTO `jh_dynamic` VALUES (14,'查询用户结果关联用户课表及空课查询关联用户信息［已完成］','查询用户结果关联用户课表及空课查询关联用户信息［已完成］方便相关权限的精弘用户查看相关信息．．．','2010-09-28 21:46:02');
INSERT INTO `jh_dynamic` VALUES (15,'空课查询时的用户列表已经按中文姓排序［已完成］','空课查询时的用户列表已经按中文姓排序［已完成］，大家可以方便的统一浏览和选择了．．．之后会开发新的便捷操作．方便大家的操作．．．敬请期待','2010-09-29 21:02:04');
INSERT INTO `jh_dynamic` VALUES (16,'2010年10月精弘重大事件：精弘网络校级组织成立大会','2010年10月精弘重大事件：精弘网络校级组织成立大会．这是精弘历史性的一次大会．它向全工大正式宣布：又一个校级组织＂精弘网络＂诞生了．我们的口号：精弘，我的五彩生活．我们的目标：服务学生的网络平台．','2010-10-06 22:42:00');
INSERT INTO `jh_dynamic` VALUES (17,'[温馨提示]精弘综合管理系统最新版域名地址：http://oa.zjut.com','[温馨提示]精弘综合管理系统最新版域名地址：http://oa.zjut.com,该域名将作为精弘内部管理系统的统一入口．．．更多功能请关注精弘最新动态','2010-10-06 22:45:38');
INSERT INTO `jh_dynamic` VALUES (18,'2010.10.24(周日)13:30-15:30精弘网络成立大会','2010.10.24(周日)13:30-15:30精弘网络成立大会，届时会有各级校级学生组织代表参会，学工部老师领导也将到会，希望精弘网络所有成员都能参会，共同庆祝这一天的到来...','2010-10-17 21:17:52');
INSERT INTO `jh_dynamic` VALUES (19,'关于参加下周日（11.21）下午13:30-广B107精弘网络干部培训班的通知','时间: 下周日(11.21)下午13:30\r\n地点: 广B107\r\n\r\n除非特殊情况请假, 不然都应该参加培训... ','2010-11-09 20:22:14');
INSERT INTO `jh_dynamic` VALUES (20,'关于2010.11.26－“求是潮记者节“活动相关安排的通知','精弘将安排以下五人［刑锟，午木，肖俏妮，王金马］参加浙江大学第五届记者节记者沙龙活动,该活动将于2010年11月26日（星期五）14：00在紫金港校区内行政楼二楼隆重举行.希望这四人能代表精弘积极的互动并带回学习交流的成果～～～','2010-11-15 21:49:32');
INSERT INTO `jh_dynamic` VALUES (21,'新功能“今日例会”上线啦！','此功能实现了精弘各部门及部门以上的各类例会时间安排的显示，根据教务处行政周及今日星期得到今日例会的部长列表并呈现在OA系统首页右侧，对于经常忘记会议的您，请及时访问http://oa.zjut.com查看每日例会情况～精弘OA－精弘网络自己的网上管理系统！','2010-11-23 20:48:58');
INSERT INTO `jh_dynamic` VALUES (22,'精弘文件柜上线啦！[验证码问题已解决]','经过将近一周的时间开发，精弘文件柜终于上线了，不过目前仍存在linux下无法上传提示验证码错误，正在解决中，敬请期待，域名为http://file.zjut.com','2010-12-06 23:00:50');
INSERT INTO `jh_dynamic` VALUES (23,'12.24-18：30【家和堂四楼】精弘网络圣诞主题活动，欢迎大家前来参加哈~','如题：活动旨在加强精弘成员的熟悉度，提高团队总体的亲切感~~~整个活动由大一常务同学负责，从策划到最后执行完全由他们进行~希望大家好好加油，为了精弘美好的明天而不懈努力~','2010-12-11 16:02:42');
INSERT INTO `jh_dynamic` VALUES (24,'新学期新气象－在精弘开心每一天！[修正、更新资料和课表]','新的一学期又已到来，欢迎新同学加入精弘，欢送元老，毕业、就业、离开、一切都是那么平静~精弘感谢你们曾经的付出，精弘会在周年庆典上邀请你们“常回来看看”,we are best, everyone and you~~~','2011-03-03 23:03:47');
